import { Home } from '../../pages/home';
import "../../styles.css";
export const Sidebar = () => {
    return (
        <>
            <div className="">

                <SidebarElements width={175} height={"100vh"}>
                    <div className="textGradient">
                        <div className="sideText">
                            <NavLink to="/" className="" color="primary"><span> Home</span></NavLink>
                            <NavLink to="/news" className="" color="primary"><span>Noticias</span></NavLink>
                            <NavLink to="/creator" className="" color="primary"><span>Creador</span></NavLink>
                            <NavLink to="/user" className="" color="secondary"><span>Usuario</span></NavLink>
                            <NavLink to="/player" className="" ><span>Reproductor</span></NavLink>
                        </div>
                    </div>
                </SidebarElements>


            </div>
        </>
    );
}



